import React, { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Navbar extends Component {

  render() {
    return (
      <nav className="navbar navbar-dark bg-dark navbar-expand-lg">
        <Link to="/" className="navbar-brand">Read Chinese</Link>
        <div className="collpase navbar-collapse">
        <ul className="navbar-nav mr-auto">
          <li className="navbar-item">
          <Link to="/practice" className="nav-link">practice</Link>
          </li>
          <li className="navbar-item">
          <Link to="/test" className="nav-link">test</Link>
          </li>
          <li className="navbar-item">
          <Link to="/typeassist" className="nav-link">type assist</Link>
          </li>
          <li className="navbar-item">
          <Link to="/characterlist" className="nav-link">characters</Link>
          </li>
          <li className="navbar-item">
          <Link to="/about" className="nav-link">about</Link>
          </li>
        </ul>
        </div>
      </nav>
    );
  }
}
